import React from 'react';
import { Image , StyleSheet} from 'react-native';

import topo from '../../assets/topo.png';

export default function Cesta() {
    return <Image source={topo} />
}

const style = StyleSheet.create({

    topo: {
        width:"100%",
    }

});
